Commit to a dream, then run with it.

@sophiehahnt38 shows us when you’ve given everything to get to the start line, only you get to define how you finish.

Redefining how we win is why we Play New.

It’s not how far you go. It’s who you take with you. 

@kipchogeeliud helps all of us break our limits. 

Redefining barriers is why we Play New.

Dreams are meant to be chased.

@athiiing is proving that dreams are lucky to keep up with her.

When we outrun what’s in front of us, we Play New.
